function MainContent({ arrayBlock }) {
    return (
        <main >
            {
                arrayBlock.map((item) => (
                    <div className="shop-items">
                        <p className="shop-l">кроссовки</p>
                        <p className="shop-o"> puma</p>

                    </div>
                ))
            }
        </main>
    );
}

export default MainContent;
